CREATE TABLE IF NOT EXISTS "Orders" (
	"ID"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"stockID"	INTEGER NOT NULL,
	"Price"	REAL NOT NULL,
	"Quantity"	INTEGER NOT NULL,
	"Commission"	REAL NOT NULL,
	"PersonID"	INTEGER NOT NULL,
	CONSTRAINT "FK_Orders_Persons_PersonID" FOREIGN KEY("PersonID") REFERENCES "Persons"("PersonID") ON DELETE CASCADE,
	CONSTRAINT "FK_Orders_Stock_stockID" FOREIGN KEY("stockID") REFERENCES "Stock"("ID") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "Stock" (
	"ID"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"Name"	TEXT,
	"Price"	REAL NOT NULL
);
CREATE TABLE IF NOT EXISTS "Persons" (
	"PersonID"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"PersonName"	TEXT,
	"PersonType"	TEXT,
	"BrokerID"	INTEGER,
	CONSTRAINT "FK_Persons_Persons_BrokerID" FOREIGN KEY("BrokerID") REFERENCES "Persons"("PersonID") ON DELETE RESTRICT
);
CREATE TABLE IF NOT EXISTS "__EFMigrationsHistory" (
	"MigrationId"	TEXT NOT NULL,
	"ProductVersion"	TEXT NOT NULL,
	CONSTRAINT "PK___EFMigrationsHistory" PRIMARY KEY("MigrationId")
);
